function $childNode(o) {
    return window.frames[o]
}
function animationHover(o, e) {
    o = $(o),
    o.hover(function() {
        o.addClass("animated " + e)
    },
    function() {
        window.setTimeout(function() {
            o.removeClass("animated " + e)
        },
        2e3)
    })
}
function WinMove() {
    var o = "[class*=col]",
    e = ".ibox-title",
    i = "[class*=col]";
    $(o).sortable({
        handle: e,
        connectWith: i,
        tolerance: "pointer",
        forcePlaceholderSize: !0,
        opacity: .8
    }).disableSelection()
}